  false,\n\t\"url\": null,\n\t\"notes\": \"This collection contains digital photographs
  of foreign paper meteorological records from the 2000+ cubic foot collection of
  physical records at the NOAA National Climatic Data Center. The images contain in-situ
  observations from all areas of the globe other than the United States. African observations
  were the initial geographic area of concentration in the imaging effort but have
  grown to include other continents and regions. The collection consists of weather
  observations that were taken almost exclusively between 1885 and 1980. The records
  are in various native languages.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
